import React from 'react';
import CardList from './CardList';
import {robots} from './Robots';
import SearchBox from './searchbox';



class App extends React.Component
{
	constructor()
	{
		super()
		this.state={
			robots: robots,
			searchField: ''
		}
	}
	render()
	{
		return(
			<div className='tc'>
				<h1>RoboFriends</h1>
				<SearchBox />
				<CardList robots={robots} />
			</div>
		);	
	}
}


export default App;
